import React from "react";
import { useContext } from "react";
import { gall } from "./Main";
export default function Like() {
  const data = useContext(gall);
  console.log(data);
  return (
    <>
      {data.map((i) =>
        i.map((index, item) => {
          return (
            <div>
              {index.id ? <h1>{index.author}</h1> : alert("already add")}
              <div className="card" style={{ width: "20rem" }}>
                <img
                  className="card-img-top"
                  src={index.download_url}
                  alt="Card image cap"
                />
              </div>
            </div>
          );
        })
      )}
    </>
  );
}
